import React, { Component } from 'react'
import { getGuides } from '../../service/api'

export default class List extends Component {
     state = {
          guides: []
     }


     getAllGuides = () => {
          getGuides()
               .then(response => {
                    console.log(response)
                    this.setState({
                         guides: response
                    });
               });
     }

     componentDidMount() {
          this.getAllGuides()
     }

     render() {
          console.log(this.state.guides[0])
          return (
               <div>
                    {this.state.guides.map(el => <div>{el}</div>)}
               </div>
          )
     }
}
